ads.description:
Auto w ciągłej eksploatacji, aktualne opłaty, koła 18", DSP.

Klima do nabicia.

Historia serwisowania na tel.

Dodaje mnóstwo części zamiennych min:

Nowe sprężyny przód, tył;

Lampy tył niepopękane;

Lusterka zew.;

Maglownica;

Przewody klimy;

Wentylator nawiewu;

Dwa ICSy;

Mechanizm wycieraczek i wiele innych.

Na sprzedaż rodzinne, pojemne i bezpieczne auto VOLVO V50.

Pierwsza rejestracja i właściciel w kraju w 2017r. 



Auto zaraz po zakupie miało robionego chipa w KIVI RACING głównie ze względów ekonomicznych (spalanie 4.2l/100 trasa) o ile dobrze pamiętam moc 170 km / 420 nm. W ostatnim czasie wymieniona pompa wspomagania oraz akumulator :-)



Z racji wieku auta nie jest w idealnym stanie lakierniczym - na tylnej klapie jest jedna mała "wgniotka" (którą prawdopodobnie bez problemu można wyciągnąć), lewy, tylny błotnik nadgryziony zębem czasu, a na prawym jest lekka obcierka. Przednie oraz tylne lampy zabezpieczone folią.



Dodatkowe info:



- Przebieg 296 000km;

- Ostatnie badanie techniczne 06.2025;

- Bogata wersja wyposażenia Momentum;

- Jasne skóry;

- Elektryczne szyby i lusterka;

- Czujnik zmierzchu;

- Automatyczne wycieraczki;

- Manualna sześciobiegowa skrzynia biegów;

- Tempomat;

- Dwa kluczyki;

- Centralny zamek;

- Alarm;

- Oryginalne radio CD;

- System auta w języku polskim;

- Światła mgielne;

- Klimatyzacja (100% sprawna - kończy się środek);

- System isofix;

- Alufelgi 16 oryginalne volvo.



+ Pozostałe rzeczy dostępne w wersji momentum.



Proszę o kontakt telefoniczny lub sms oraz zapraszam do oględzin :)
